import React, { Component } from "react";
import "../styles/selectPlant.scss"

export default class SelectPlant extends Component {
  state = {
    plants: [
      { id: 0, name: "sapling" },
      { id: 1, name: "root tree" },
    ],
    tools: [{ type: 0, name: "small pot" }],
  };
  render() {
    return (
      <div className="table-select-plant">
          <h1>Add Plant</h1>
          <label>Select plant</label>
        <div id="plants">
          {this.state.plants.map((item, index) => {
            return (
                <img src={item.name} alt="" onClick={() => this.handle} />
            )
          })}
        </div>
        <button id="submit-add-plant">Submit</button>
      </div>
    );
  }
}
